import React from 'react';
import { usageAPI } from './axios';

class Home extends Component {

  componentDidMount() {
    usageAPI.get().then(res => {console.log(res)});
  }

  render() {
    return(
      <div>
        <h3>Home View</h3>
      </div>
    );
  }
};

export default Home;
